Corinne Diacre, née le {{date|4|août|1974}} à [[Croix (Nord)|Croix]] ([[Nord (département français)|Nord]]), est une [[football]]euse [[Équipe de France féminine de football|internationale]] [[France|française]], de la fin des années 1980 au milieu des années 2000, devenue [[Entraîneur (football)|entraîneuse]]. Elle devient, en 2014, la première Française à entraîner une équipe masculine de football professionnel ([[Clermont Foot 63]], alors en [[Championnat de France de football de deuxième division|Ligue 2]]).

Enfant, Diacre débute le [[football]] dans la [[Creuse (département)|Creuse]] à l'A.S.Saint Sebastien-Azerables (ASSA), où ses parents sont mutés. À seulement quatorze ans, elle rejoint l'[[Association sportive jeunesse Soyaux-Charente|ASJ Soyaux]], un des meilleurs clubs féminins du moment. Ses parents l'amènent en [[Charente (département)|Charente]] avant qu'elle soit hébergée par son entraîneur. Diacre évolue toute sa carrière à l'ASJ Soyaux, au poste de [[Défenseur (football)|défenseuse]] centrale, en [[Championnat de France féminin de football|première division]]. Diacre dispute environ 350 rencontres avec Soyaux sans parvenir à remporter de titre. Son plus beau fait d'arme est la seconde place et le titre honorifique de vice-championne de France au terme de la [[Championnat de France féminin de football 1995-1996|saison 1995-1996]]. Durant sa carrière, Diacre refuse à plusieurs reprises des offres depuis le [[Championnat des États-Unis féminin de soccer|championnat des États-Unis]], ne souhaitant pas sacrifier sa vie professionnelle en parallèle de sa carrière amateur.

Corinne Diacre est sélectionnée en [[Équipe de France de football féminin|équipe de France féminine]] dès ses 18 ans, elle y jouera durant douze années. On retient notamment son but lors du barrage retour face à l'Angleterre, qui permet aux Bleues de disputer la première [[Coupe du monde féminine de football|Coupe du monde]] de leur histoire en [[Coupe du monde féminine de football 2003|2003]]. Elle dispute aussi trois phases finales de [[Championnat d'Europe féminin de football|Championnat d'Europe]], en [[Championnat d'Europe féminin de football 1997|1997]], [[Championnat d'Europe féminin de football 2001|2001]] et [[Championnat d'Europe féminin de football 2005|2005]], sans jamais passer la phase de groupe. Diacre prend sa retraite internationale au terme de cette dernière compétition, avec 121 sélections (alors un record) et quatorze buts. Elle est la seconde joueuse à totaliser le plus de [[Capitaine (football)|capitanats]] (69 fois).

Dès 2007 et sa retraite des terrains, Corinne Diacre intègre le staff du nouveau sélectionneur des Bleues, [[Bruno Bini]]. En 2010, Diacre devient en parallèle entraîneuse de l'ASJ Soyaux, qu'elle fait immédiatement remonter en D1. Elle reste en poste trois saisons pour deux montées et une relégation. En 2014, elle devient entraîneuse du [[Clermont Foot 63]]. Diacre devient la [[Liste des premières femmes par métier ou fonction en France|première femme]] à entraîner à long terme une équipe professionnelle masculine. Elle déjoue les pronostics sexistes<ref>{{Lien web |langue=fr |titre=Corinne Diacre, celle qui a tout changé pour les femmes dans le foot |url=https://www.20minutes.fr/sport/football/2123895-20170830-equipe-france-milieu-hommes-corinne-diacre-tout-change-femmes-foot |site=www.20minutes.fr |date=2017-08-30 |consulté le=2023-03-09}}</ref> avec la meilleure place de l'histoire du club lors de sa seconde saison. Le {{Date-|30 août 2017}}, Diacre est nommée sélectionneuse de l'[[équipe de France féminine de football|équipe de France féminine]]. Elle amène ses joueuses jusqu'en quarts de finale de la Coupe du monde 2019, avant d'être sérieusement contestée par une partie de son effectif. Longtemps remise en question, elle est toujours en poste pour l'Euro 2022, initialement prévu en 2021, et amène les Bleues à leur deuxième demi-finale de l'histoire. 

Le 9 mars 2023, elle est démise de ses fonctions de sélectionneuse de l'[[Equipe de France féminine de football|équipe de France féminine]].

